import { Grid } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";
import './signstyle.css'

export default function Signin() {
  
  return (
    <Box sx={{ flexGrow: 1 }}>
      <Grid container >
        <Grid item xs={8}>
          <div>xs=8</div>
        </Grid>
        <Grid item xs={4} className="rightGrid">
          <div>xs=4</div>
        </Grid>
      </Grid>
    </Box>
  );
}
